          profileData.extra = extra;
        } catch (e) {}
        // Take screenshot of profile modal
        await page.screenshot({ path: path.join(screenshotsDir, `step_3_profile_${i+1}.png`) });
        screenshots.push(path.join(screenshotsDir, `step_3_profile_${i+1}.png`));
        // Try to close the modal (press Escape)
        try { await page.keyboard.press('Escape'); await page.waitForTimeout(300); } catch (e) {}
      } else {
        // Try to extract info from member element itself
        try {
          const username = await member.$eval('.username, [class*=username]', el => el.innerText.trim());
          profileData.username = username;
        } catch (e) {}
        try {
          const status = await member.$eval('.user-status, [class*=status]', el => el.innerText.trim());
          profileData.status = status;
        } catch (e) {}
        try {
          const avatarUrl = await member.$eval('img', el => el.src);
