import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // STEP 2: Ensure the member list is visible. Try clicking the "Member List" icon if needed
    // Use aria-label or icon id as selector
    const memberListBtnSelector = '#toggle-member-list';
    await page.waitForSelector(memberListBtnSelector, { timeout: 5000 });
    const memberListBtn = await page.$(memberListBtnSelector);
    if (memberListBtn) {
      // Try clicking in case list is hidden (click is idempotent if already visible)
      await memberListBtn.click();
    }

    // Wait for the member list panel to appear (use class, id, or structure)
    // We have to guess the member list selector since it's not in available HTML, so let's try possible options:
    // Try to find a sidebar or panel with members - look for a div with class including "member-list"
    let memberListSelector = 'div[class*="member-list"]';
    let memberListEl = await page.$(memberListSelector);

    // Fallback: try to find by icon structure (users icon triggers member list, so look for adjacent panels)
    // If not found, try to get the rightmost sidebar: find all "div" direct children of ".app-container" and pick the last one
    if (!memberListEl) {
      const appContainerSelector = '.app-container';
      await page.waitForSelector(appContainerSelector, { timeout: 8000 });
      const sidebars = await page.$$(appContainerSelector + ' > div');
      if (sidebars.length >= 3) {
        // Heuristic: last sidebar is likely member list
        memberListEl = sidebars[sidebars.length - 1];
      }
    }

    if (!memberListEl) {
      throw new Error('Member list panel could not be found');
    }

    // STEP 3: Find all member elements in the member list
    // Try several strategies for member selectors:
    // - Avatar images in member list
    // - Username elements
    // Since the only user shown in mock data is "jun", look for any user avatar or username not in sidebar
    // Try to get all img tags inside memberListEl
    const memberAvatars = await memberListEl.$$('img');
    let memberElements = [];
    if (memberAvatars.length > 0) {
      // Get parent elements (likely the member containers)
      for (let avatar of memberAvatars) {
        const parent = await avatar.evaluateHandle(node => node.parentElement);
        memberElements.push(parent);
      }
    } else {
      // Fallback: try to find all username divs in memberListEl
      memberElements = await memberListEl.$$('div.username');
    }

    if (memberElements.length === 0) {
      // As a last resort, click the user avatar at the bottom left (".user-info .user-avatar")
      const userAvatarSidebar = await page.$('.user-info .user-avatar');
      if (userAvatarSidebar) {
        memberElements = [userAvatarSidebar];
      }
    }

    if (memberElements.length === 0) {
      throw new Error('No member elements found in the member list');
    }

    // STEP 4: For each member, click and extract profile information
    const extractedProfiles = [];
    let memberIdx = 0;
    for (const memberEl of memberElements) {
      // Scroll into view if necessary
      try {
        await memberEl.evaluate(el => el.scrollIntoView({ block: 'center' }));
      } catch (_) {}

      // Click to open profile (if clickable, otherwise try hover)
      try {
        await memberEl.click({ force: true });
      } catch (_) {
        // Try hover instead
        try {
          await memberEl.hover();
        } catch (_) {}
      }

      // Wait for a user profile popup/dialog to appear
      // Look for a modal/dialog with username or avatar
      let profileDialog = null;
      let profileSelector = 'div[class*="profile"], div[class*="user-profile"], div[class*="modal"]';
      try {
        await page.waitForSelector(profileSelector, { timeout: 2000 });
        const dialogs = await page.$$(profileSelector);
        if (dialogs.length > 0) {
          // Heuristic: pick the dialog that is not the sidebar
          profileDialog = dialogs[dialogs.length - 1];
        }
      } catch (_) {}

      // As fallback, look for any visible modal/dialog after click
      if (!profileDialog) {
        // Try any div[role="dialog"]
        const dialogs = await page.$$('div[role="dialog"]');
        if (dialogs.length > 0) {
          profileDialog = dialogs[dialogs.length - 1];
        }
      }

      // Wait for a short time for profile to load
      await page.waitForTimeout(500);

      // Take screenshot of profile popup if visible
      const screenshotPath = path.join(screenshotsDir, `step_2_profile_${memberIdx + 1}.png`);
      await page.screenshot({ path: screenshotPath });
      screenshots.push(screenshotPath);

      // Extract profile data
      let username = null;
      let status = null;
      let avatarUrl = null;
      let extra = {};

      if (profileDialog) {
        // Try to extract username, status, avatar from dialog
        username = await profileDialog.$eval('.username', el => el.textContent).catch(() => null);
        status = await profileDialog.$eval('.user-status', el => el.textContent).catch(() => null);
        avatarUrl = await profileDialog.$eval('img', el => el.src).catch(() => null);
      } else {
        // Fallback: Extract from member element itself
        username = await memberEl.$eval('.username', el => el.textContent).catch(() => null);
        status = await memberEl.$eval('.user-status', el => el.textContent).catch(() => null);
        avatarUrl = await memberEl.$eval('img', el => el.src).catch(() => null);
      }

      // Try to extract additional data (e.g. user id, role, etc) if available
      // Look for .user-details or any data-* attributes
      let userDetails = {};
      if (profileDialog) {
        const userDetailsEl = await profileDialog.$('.user-details');
        if (userDetailsEl) {
          userDetails.username = await userDetailsEl.$eval('.username', el => el.textContent).catch(() => null);
          userDetails.status = await userDetailsEl.$eval('.user-status', el => el.textContent).catch(() => null);
        }
      }

      // Combine data
      extractedProfiles.push({
        username: username || userDetails.username || null,
        status: status || userDetails.status || null,
        avatar: avatarUrl || null,
        ...extra
      });

      // Close the profile popup/modal if present
      // Try pressing Escape or clicking a close button
      try {
        // Look for a close 'Ã—' button
        const closeBtn = await page.$('button.close-search, button[aria-label="Close"], button[title="Close"]');
        if (closeBtn) {
          await closeBtn.click();
        } else {
          await page.keyboard.press('Escape');
        }
      } catch (_) {}

      // Wait briefly before next member
      await page.waitForTimeout(400);

      memberIdx++;
    }

    // Remove duplicate profiles (in case of multiple sidebars/avatars)
    const uniqueProfiles = [];
    const seenUsernames = new Set();
    for (const prof of extractedProfiles) {
      if (prof.username && !seenUsernames.has(prof.username)) {
        uniqueProfiles.push(prof);
        seenUsernames.add(prof.username);
      }
    }

    return {
      success: true,
      action: "Harvested user profiles from member list by clicking each member and extracting their profile data.",
      extractedData: {
        profiles: uniqueProfiles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
